import React,{Component} from 'react';
import 'tachyons';
import './App.css';
import Home from './home.js';
import Work from './work.js';
import Contact from './contact.js';
//import Contact from './contact.js';


class App extends Component {
  constructor() {
    super();
  this.state={
    route:'home'
  }}
  render(){
  const{route} = this.state;
    return (
      <div>
      <div className="Home" style={{backgroundcolor:'black'}}>
      <div className="topnav">
       <h5 className="head">  Debugged.exe </h5>
       &nbsp;
       <ol className="navhead" type="1">
        <li><a href="#" class="nav" >About us</a></li>
        <li><a href="#" class="nav"> Our work</a></li>
        <li><a href="#" class="nav">Contact us</a></li>
       </ol>
       </div>
     </div>

     {
         route === 'home'
       ?  <div>
          <Home/>
       </div>:
         <Contact/>
     }
    </div>
    );
  }
}

export default App;
